con:configuration.scriptText:
import com.eviware.soapui.support.XmlHolder


def holder = new XmlHolder( messageExchange.responseContentAsXml )
def responseXml = holder.getPrettyXml()

holder.Body.response.ListOfCountryNamesByCodeResult.tCountryCodeAndName.findAll { ISOCode ->
    ISOCode.sISOCODE.text() == 'GN' 
}.each { name -> 
    assert name.sName.text() == "Guinea"
}

con:configuration.path:
declare namespace soap='http://www.w3.org/2003/05/soap-envelope';
declare namespace m='http://www.oorsprong.org/websamples.countryinfo';

<MyResult>
{
for $x in //m:tCountryCodeAndName
where starts-with($x/m:sName/text(),'G')
return
<value>
 {$x/m:sName/text()}
</value>
}
</MyResult>
